import React from 'react';

function Home() {
  const containerStyle = {
    padding: '40px',
    fontFamily: '"Times New Roman", serif',
    color: '#000',
    backgroundColor: '#fff',
    minHeight: '80vh',
    textAlign: 'center'
  };

  const headingStyle = {
    fontSize: '3rem',
    fontWeight: 'bold',
    marginBottom: '20px'
  };

  const pStyle = {
    fontSize: '1.2rem',
    maxWidth: '600px',
    margin: '0 auto'
  };

  return React.createElement('div', {style: containerStyle},
    React.createElement('h1', {style: headingStyle}, 'Welcome to Dior Digital Experience'),
    React.createElement('p', {style: pStyle}, 'Discover Dior products and locations with elegance and simplicity.')
  );
}

export default Home;
